  themeKey: 'fontWeight'
}); // The default system themeKey is typography

export const letterSpacing = style({
  prop: 'letterSpacing',
  themeKey: 'letterSpacing'
});
export const lineHeight = style({
  prop: 'lineHeight',
  themeKey: 'lineHeight'
